function toc(){var e=document.getElementById("_instructions"),t=["H1","H2","H3","H4","H5","H6"],l=e.querySelectorAll(t),n="<ul>",o="";l.forEach(e=>{o=t.indexOf(e.tagName);for(let e=0;e<o;e++)n+="<ul>";n+="<li>"+e.innerText+"</li>";for(let e=0;e<o;e++)n+="</ul>"}),n+="</ul>",document.getElementById("toc").innerHTML=n}